import axios from "axios";

export const registerSubmitHandler = async (userName, userPassword) => {
  const res = await axios.post("http://localhost:5050/routes/register", {
    username: userName,
    password: userPassword,
  });
  const data = await JSON(res);
  console.log(
    "ðŸš€ ~ file: registerSubmitHandler.js:9 ~ registerSubmitHandler ~ data:",
    data
  );
};
